import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { BlogRoutingModule } from './blog-routing.module';

import { BlogListComponent } from './pages/list/list.component';
import { BlogViewComponent } from './pages/view/view.component';
import { BlogEditComponent } from './pages/edit/edit.component';

@NgModule({
  declarations: [
    BlogListComponent,
    BlogViewComponent,
    BlogEditComponent,
  ],
  imports: [
    CommonModule,
    FormsModule,
    ReactiveFormsModule,
    BlogRoutingModule,
  ],
})
export class BlogModule {}
